import React from 'react';
import { Routes, Route, Redirect } from "react-router-dom";
import About from './About';


const App = () =>{
    return(
        <>
            <Routes>
                <Route exact path='/' Component={About} />
                <Redirect to='/' />
            </Routes>
        </>
    )
}

export default App;
